import axios from "axios"

// Get user data
function fetchUserData(API_URL,) {
    API_URL = "http://localhost:1234/api/users";
    axios
    .get(API_URL)
      .then(response => (this.info = response.data.User))
      .catch((error) => {
        console.error("Error: ", error);
      });
    // document.getElementById("quote").innerHTML = "hello";
  }

export default {
    fetchUserData,
}
